import { wrapper } from "../store/store"
import Grid from "@material-ui/core/Grid"

const WrappedApp = ({ Component, pageProps }) => {
	return (
		<>
			<Grid container spacing={0} justify="space-around">
				<Component {...pageProps} />
			</Grid>
		</>
	)
}

export default wrapper.withRedux(WrappedApp)
